SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

--
-- Base de données et utilisateur :  formation_webapp
--
CREATE USER 'formation_webapp'@'%' IDENTIFIED WITH mysql_native_password;GRANT USAGE ON *.* TO 'formation_webapp'@'%' REQUIRE NONE WITH MAX_QUERIES_PER_HOUR 0 MAX_CONNECTIONS_PER_HOUR 0 MAX_UPDATES_PER_HOUR 0 MAX_USER_CONNECTIONS 0;SET PASSWORD FOR 'formation_webapp'@'%' = PASSWORD('formation_webapp');CREATE DATABASE IF NOT EXISTS `formation_webapp` DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci;;GRANT ALL PRIVILEGES ON `formation\_webapp`.* TO 'formation_webapp'@'%';
USE formation_webapp;

